/// use regex::Regex;
///
/// let re = Regex::new(r"'([^']+)'\s+\((\d{4})\)").unwrap();
/// let hay = "Not my favorite movie: 'Citizen Kane' (1941).";
/// let (full, [title, year]) = re.captures(hay).unwrap().extract();
/// assert_eq!(full, "'Citizen Kane' (1941)");
/// assert_eq!(title, "Citizen Kane");
/// assert_eq!(year, "1941");
/// ```
